import React, { useState, useEffect } from 'react'

const Logs = () => {
  const [data, setData] = useState({ hits: [] })

  useEffect(async () => {
    const result = await axios(
      'https://hn.algolia.com/api/v1/search?query=redux'
    )

    setData(result.data)
  }, [])

  return <div>logs</div>
}

export default Logs
